import React, { useEffect, useRef } from 'react';
import {gsap} from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';
import './App.css';
import HomeSection from './components/BeforeLogIn/HomeSection';
import Features from './components/BeforeLogIn/Features';


gsap.registerPlugin(ScrollTrigger);


function App() {



  return (


    <body id='body' data-scroll-container>

      <HomeSection className="home section"/>

      <Features data-scroll data-scroll-speed="4" />

      <section id='section3' className='section' data-scroll>
        <h1  data-scroll data-scroll-speed="3">Section 3</h1>
      </section>

      <section id='section4' className='section' data-scroll>
        <h1>Section 4</h1>
      </section>

      <section id='section5' className='section' data-scroll>
        <h1 >Section 5</h1>
      </section>


    </body>

  );
}

export default App;
